import React, { useState } from "react";
import { Link } from "react-router-dom";
import MenuIcon from "@mui/icons-material/Menu";
import PersonIcon from "@mui/icons-material/Person";
import Badge from "@mui/material/Badge";
import toast from "react-hot-toast";
import { useAuth } from "../../context/auth";
import { useCart } from "../../context/cart";
import Cart from "../../pages/CartPage";

const Header = () => {
  const [auth, setAuth] = useAuth();
  const [cart] = useCart();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    setAuth({
      ...auth,
      user: null,
      token: "",
    });
    localStorage.removeItem("auth");
    toast.success("Logout Successfully");
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <>
      <nav className="bg-gray-900 sticky top-0 w-full z-20 px-5 py-1">
        <div className="max-w-screen-xl flex items-center justify-between mx-auto p-4">
          <div className="flex items-center">
            <img src="your-logo-url" className="h-12 mr-3" alt="Logo" />
            <span className="self-center text-2xl font-bold whitespace-nowrap dark:text-white">
              CARTCRAFT
            </span>
          </div>

          {/* Mobile menu button */}
          <button
            type="button"
            className="md:hidden"
            onClick={toggleMobileMenu}
          >
            <MenuIcon />
          </button>
        </div>
      </nav>

      {/* Mobile Drawer */}
      {isMobileMenuOpen && (
        <div className="bg-gray-900 w-full text-white p-4">
          <ul className="space-y-2">
            <li>
              <Link to="/" className="text-gray-300">
                Home
              </Link>
            </li>
            <li>
              <Link to="/contact" className="text-gray-300">
                Contact
              </Link>
            </li>
            {!auth.user ? (
              <>
                <li>
                  <Link to="/login" className="text-gray-300">
                    Login
                  </Link>
                </li>
                <li>
                  <Link to="/register" className="text-gray-300">
                    Register
                  </Link>
                </li>
              </>
            ) : (
              <>
                <li>
                  <Link
                    to={`/dashboard/${auth.user.role === 1 ? "admin" : "user"}`}
                    className="text-gray-300"
                  >
                    Dashboard
                  </Link>
                </li>
                <li>
                  <button className="text-gray-300" onClick={handleLogout}>
                    Logout
                  </button>
                </li>
              </>
            )}
            <li>
              <Link to="/cart" className="text-gray-300">
                Cart{" "}
                <Badge badgeContent={cart.length} color="error">
                  <Cart />
                </Badge>
              </Link>
            </li>
          </ul>
        </div>
      )}
    </>
  );
};

export default Header;
